import React from 'react';
const RecordButton = (onClick) => {

    const recordStyles = {
        height: "25px",
        width: "25px",
        backgroundColor: "#eb4f34",
        borderRadius: "50%",
        display: "inlineBlock",
    }


  return (
    <div style={recordStyles}></div>
  );
}

export default RecordButton
